// src/components/TopNav.js
import React from 'react';
import '../styles/Common.css';

const TopNav = () => {
  return (
    <div className="top-nav">
      <img src='tiktokstudiologo-removebg-preview.png' alt="TikTok Studio" className="logo" />
      <img  alt="User Profile" className="user-profile-pic" />
    </div>
  );
};

export default TopNav;
